import { Box, Button, Stack, Typography, styled } from '@mui/material'
import React from 'react'
import Theme from '../../Component/Theme';

const theme=Theme();

const UserTitleBox=styled(Stack)(({theme})=>({
    marginTop:"10px",
    marginBottom:"20px",
    width:500,
    [theme.breakpoints.down("md")]:{
        width:350,
    },
    //backgroundColor:"red",
    //paddingLeft:"100px",
    //paddingRight:"100px",
    textAlign:"center",

}))

export default function Recovery({setRecoveryModel}) {
  return (
    <Stack sx={{
        backgroundColor:theme.palette.background.paper,
        width:700,
        height:800,
        borderRadius:theme.shape.borderRadius,
        }}>
        <Stack display="flex" direction="row" justifyContent='end'>
            <Button 
                onClick={()=>setRecoveryModel(false)}
            >X
            </Button>
        </Stack>

        <Stack alignItems="center">
            <UserTitleBox>
                <Typography variant="h3">Recovery Password</Typography>
            </UserTitleBox>
        </Stack>

    </Stack>
  )
}
